import React from 'react'
import { View, StyleSheet, Text, Image  } from 'react-native'

export const Profile = props => {
    return (
        <View style={styles.container}>
            <Image style={styles.avatar}
                   source={require('../img/avatar.png')}
                   style={{ width: 120, height: 120}}
            />
            <Text style={styles.name}>{props.name}</Text>
            <Text style={styles.bio}>{props.city}, Rus â€¢ {props.age} years</Text>
            <Text style={styles.rate}> {props.rate} rate </Text>
            <Text style={styles.subTitle}>Progress</Text>
        </View>


    )
}

const styles = StyleSheet.create ({

    container: {
        height: 288,
        alignItems: 'center',
        justifyContent: 'center',
        shadowColor: '#e6e6e6',
        shadowOffset: {
            width: 0,
            height: 6,
        },
        shadowOpacity: 0.39,
        shadowRadius: 8.30,

        elevation: 13
    },
    avatar:{
        alignItems: 'center',
        justifyContent: 'center'
    },
    name: {
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontSize: 24,
        lineHeight: 35,
        paddingTop:10,
        paddingBottom:10
    },
    bio: {
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontSize: 17,
        lineHeight: 21,
    },
    rate: {
        color: '#E15241'
    },
    subTitle: {
        flex: 1,
        alignItems: 'flex-start',
        justifyContent: 'center',
        fontFamily: 'Roboto',
        fontStyle: 'normal',
        fontSize: 24,
        lineHeight: 28,
        paddingBottom: 20,
        paddingLeft:20
    }

})
